import React, { useEffect } from "react";
import { Link } from "react-router-dom";

const Error404 = () => {
  // Load admin CSS for this standalone page
  useEffect(() => {
    const cssFiles = [
      "/admin-assets/vendors/mdi/css/materialdesignicons.min.css",
      "/admin-assets/vendors/css/vendor.bundle.base.css",
      "/admin-assets/css/style.css"
    ];

    cssFiles.forEach((href) => {
      if (!document.querySelector(`link[href="${href}"]`)) {
        const link = document.createElement("link");
        link.rel = "stylesheet";
        link.href = href;
        link.setAttribute("data-admin-css", "true");
        document.head.appendChild(link);
      }
    });

    return () => {
      document.querySelectorAll('link[data-admin-css="true"]').forEach((link) => {
        link.remove();
      });
    };
  }, []);

  return (
    <div className="container-scroller">
      <div className="container-fluid page-body-wrapper full-page-wrapper">
        <div className="content-wrapper d-flex align-items-center text-center error-page bg-primary">
          <div className="row flex-grow">
            <div className="col-lg-7 mx-auto text-white">

              <div className="row align-items-center d-flex flex-row">
                <div className="col-lg-6 text-lg-right pr-lg-4">
                  <h1 className="display-1 mb-0">404</h1>
                </div>

                <div className="col-lg-6 error-page-divider text-lg-left pl-lg-4">
                  <h2>SORRY!</h2>
                  <h3 className="font-weight-light">
                    The page you're looking for was not found.
                  </h3>
                </div>
              </div>

              <div className="row mt-5">
                <div className="col-12 text-center mt-xl-2">
                  <Link to="/admin" className="text-white font-weight-medium">
                    Back to Dashboard
                  </Link>
                </div>
              </div>

              <div className="row mt-5">
                <div className="col-12 mt-xl-2">
                  <p className="text-white font-weight-medium text-center">
                    Copyright Â© 2025 All rights reserved.
                  </p>
                </div>
              </div>

            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Error404;
